        </div>
    </header>
    <!-- end header -->




    <!-- Start landing -->
     <div class="landing">
        <div class="overlay">
            <div class="text">
                <div class="content">
                    <h2> Welcome!
                        <br>
                        We care hospital website.
                    </h2>
                    <p class="pre">Your Health is Our Top Priority with Comprehensive, Affordable medical.</p>
                    <a href="/signup" class="button">sign up for free</a>
                    <a href="/login" class="button">log in for free</a>

                </div>
            </div>
        </div>
        <i class="fas fa-angle-double-left angle"></i>
        <i class="fas fa-angle-double-right angle"></i>
        <ul class="bullets">
            <li></li>
            <li class="active"></li>
            <li></li>
        </ul>
    </div>
    <!-- End landing  -->
















